@calistathepitbull is running a limited time fundraiser to benefit the @standupforpitsfoundation! The merchandise is only available for three more days!!!! 
100% of the proceeds from this campaign will go to the Stand Up For Pits Foundation (SUFP), a 501c3 non profit. SUFP is dedicated to ending the abuse and discrimination of pit bull type dogs. They fund frontline rescue efforts, but also focus on innovative interventions (dog fighting tip line, education for police on removing dogs in hot cars, policy change), and preventive programs (spay & neuter). They are forward thinking, dedicated, and we are honored to support them. To learn more about SUFP, please visit standupforpits.us! Thank you all! 

